import { useState, useEffect } from 'react';
import axios from 'axios';

// fetch('http://api-sousmontoit.am.manusien-ecolelamanu.fr/public/staff').then((response) => {
//     console.log(response);
// })


const UserAccountComponents = () => {

    const [staffData, setStaffData] = useState({})
    const [loading, setLoading] =  useState(true)

        
useEffect(()=>{
    axios.get("http://api-sousmontoit.am.manusien-ecolelamanu.fr/public/staff")
    .then(res=>{
        // console.log('coucou');
        setStaffData(res.data);

    }).catch(error=>{
        
        console.log('coucou 2');
        console.log(error.message)

    }).finally(()=>{

        setLoading(false);

    })
},[])

    if(loading){

        return <p>Chargement en cours..</p>

    }
    return (
        
        <div className="container ">
            <div className="row">
                <div className="my-3 text-center">
                    <h1>Mon compte</h1>
                </div>

                <div className="card" >
                    <ul className="list-group list-group-flush">
                      <a href=""></a>  <li className="list-group-item p-3">An item</li>
                       <a href=""></a> <li className="list-group-item p-3">A second item</li>
                       <a href=""></a> 
                    </ul>
                    <div className="card-footer">
                        Card footer
                    </div>
                </div>
            </div>
        </div> 
            
      
  
    );
};

export default UserAccountComponents
